import { AppBar, Toolbar } from '@mui/material'
import { FacebookIcon } from '@mui/icons-material';
import './NavBar.css'



export default function NavBar() {
  return (
    <AppBar position="static" style={{ background: '#368a37' }}>
      <Toolbar>
        David's Gardening Services
        <FacebookIcon />
      </Toolbar>
    </AppBar>
  )
}
